import React from "react";
import PlaceList from "../component/PlaceList";

const DUMMY_PLACES = [
    {
        id: "p1",
        title: "Empire state building",
        description: "one of the most sky scrapers in the world!",
        imageUrl:
            "https://pbs.twimg.com/profile_images/1272532349151072262/kBEZiWIQ.jpg",
        address: "20 W 34th St, New York, NY 10001, United States",
        location: {
            lat: 40.748558,
            lng: -73.9857578,
        },
        creator: "u1",
    },
    {
        id: "p2",
        title: "Empire state building",
        description: "one of the most sky scrapers in the world!",
        imageUrl:
            "https://pbs.twimg.com/profile_images/1272532349151072262/kBEZiWIQ.jpg",
        address: "20 W 34th St, New York, NY 10001, United States",
        location: {
            lat: 40.748558,
            lng: -73.9857578,
        },
        creator: "u2",
    },
];
const UserPlaces = () => {
    return <PlaceList items={DUMMY_PLACES}></PlaceList>;
};

export default UserPlaces;
